import React from 'react';
import ReactDOM from 'react-dom';
import './style.sass';
import openSocket from 'socket.io-client';


class Camera extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      img: null
    }
  }

  componentWillMount() {
    fetch('frame.txt')
    .then(response => response.text())
    .then(data => {
      console.log(data);
      this.setState({
        // img: 'https://kopernik.kalisz.pl/wp-content/themes/koperniktheme/assets/rm-icons/kopernik_mq.png'
        img: data
      });
    });
  }

  render() {
    return (
      <div>
        {/* <img src={ this.state.img } alt="ROV camera output"/> */}
        {/* <canvas width="200" height="100"></canvas> */}
        { this.state.img }
      </div>
    );
  }
}

// ========================================

// const io = openSocket('http://localhost:3000');

ReactDOM.render(
  <Camera />,
  document.getElementById('root')
);
